import './SubjectSelection.css';

const SubjectSelection = () => {
  return (
    <div
    //   style={{
    //     display: "flex",
    //     flexDirection: "column",
    //     border: "1px solid black",
    //     padding: "10px",
    //     borderRadius: "5px",
    //     width: "300px",
    //     height: "350px",
    //     margin: "auto",
    //     marginTop: "200px",
    //     textAlign: "center",
    //   }}

      className='subjectSelection'
    >
      <h2>Select subject</h2>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
          gap: "10px",
          padding: "5px",
        }}
      >
        <div
          style={{
            padding: "5px",
            backgroundColor: "#4379F2",
            border: "1px solid black",
            borderRadius: "5px",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            width: "140px",
          }}
        >
          <p>Physics</p>
          <div>
            <img
              src="/phy.png"
              style={{
                maxWidth: "30px",
                maxHeight: "30px",
                objectFit: "contain",
              }}
            />
          </div>
        </div>
        <div
          style={{
            padding: "8px",
            backgroundColor: "#EE66A6",
            border: "1px solid black",
            borderRadius: "5px",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            width: "140px",
          }}
        >
        <p>Chemistry</p>  
        <div>
            <img
              src="/chem.png"
              style={{
                maxWidth: "30px",
                maxHeight: "30px",
                objectFit: "contain",
              }}
            />
          </div>
        </div>
        <div
          style={{
            padding: "8px",
            backgroundColor: "#FCCD2A",
            border: "1px solid black",
            borderRadius: "5px",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            width: "140px",
          }}
        >
          <p>Mathematics</p>
          <div>
            <img
              src="/maths.png"
              style={{
                maxWidth: "30px",
                maxHeight: "30px",
                objectFit: "contain",
              }}
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default SubjectSelection;
